import FINANCIAL_ACTION from "../actionTypes";

export default function submitFinancialsAction(
  grossAnnualSales,
  annualPayroll
) {
  return {
    type: FINANCIAL_ACTION,
    payload: {
      grossAnnualSales: grossAnnualSales,
      annualPayroll: annualPayroll,
    },
  };
}
